/*!

=========================================================
* Light Bootstrap Dashboard React - v2.0.1
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { useState } from "react";
import { Container } from "react-bootstrap";
import styles from "./index.module.css";
import Menu from "@mui/material/Menu";
import { MenuItem } from "@mui/material";
import {
  BackupTable,
  FiberNew,
  Help,
  Home,
  Logout,
  ManageAccounts,
  MoneyOff,
  MoneyRounded,
  Report,
  Summarize,
} from "@mui/icons-material";
import HoverMenuDropdown from "views/Menu/Menu";

const Header = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleOpenMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu1 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu2 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu3 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu4 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu5 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu6 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu7 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleOpenMenu8 = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleCloseMenu = () => {
    setAnchorEl(null);
  };
  const menuitem1 = [
    "Assembly",
    "   My Community Entry",
    "  Employee Entry",
    "Dead stock",
    "General Ledger Master",
    " Crop Master",

    "Lending Master",

    "Lending Interest Master",

    "  Master the deposit Interest",

    "  Thing Master",
  ];
  return (
    <footer className={styles.footer}>
      <Container fluid>
        <ul className={styles.footermenu}>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Home
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Home</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu2"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu1}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <ManageAccounts
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Master</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu2}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <MoneyOff
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span>Transaction</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu3}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <FiberNew
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Namu</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu4}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Summarize
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span> Report</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu5}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <BackupTable
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Utility</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu6}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Help
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <spam>Help</spam>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Logout
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span
                aria-controls="hover-menu8"
                aria-haspopup="true"
                onMouseEnter={handleOpenMenu7}
              >
                Out
              </span>
            </a>
          </li>
        </ul>
        <HoverMenuDropdown />


      </Container>
    </footer>
  );
};

export default Header;
